import "./posts.scss";
import { useQuery } from "@tanstack/react-query";

const Posts = () => {


  
  return (
    <div className="posts">
      {posts.map((post) => (
        <Post post={post} key={post.id} />
      ))}
    </div>
  );
};

export default Posts;
